import React, {useEffect, useState} from "react";

export default function MVSpecialPart() {
  const [href, setHref] = useState({
    firstHref: "APPAREL",
    lastHref: "SPECIAL PARTS",
  });
  useEffect(()=>{
    document.getElementById('right-first-href').classList.add("href-to-top");
    document.getElementById('right-last-href').classList.add("href-to-top");
    document.querySelector('.part-img-left').classList.add("img-href-hidden");
    document.querySelector(".left-part").classList.add('part-blur');
  });
  return (
    <div className="mv-special-part">
      <div className="left-part">
        <div className="left-content">
          <img
            className="mv-special-part-img part-img-left"
            alt=""
            src="./img/apparel.png"
          ></img>
          <div className="part-content-href">
            <a id="left-first-href" href>{href.firstHref}</a> {/*first*/}
            <a id="left-last-href" href>{href.firstHref}</a> {/*last */}
          </div>
        </div>
      </div>
      <div className="right-part">
        <div className="right-content">
          <img
            className="mv-special-part-img part-img-right"
            alt=""
            src="./img/special_parts.png"
          ></img>
          <div className="part-content-href">
            <a id="right-first-href" href>{href.lastHref}</a> {/*first*/}
            <a id="right-last-href" href>{href.lastHref}</a> {/*last*/}
          </div>
        </div>
      </div>
    </div>
  );
}
